import React from "react";

const ProgressBar = () => {


    return(
        <section >
            <ul className="progress_container">
                <li className="progress">
                    <section className="parts">
                        <p>3</p>
                        <span className="prog_desc">Payment</span>
                    </section>
                </li>
            </ul>
        </section>      
    )
}
export default ProgressBar;
